pui.runtimeText.fr_FR["show hmpg start hlp"]="Si coch\u00e9, une page d'accueil personnalisable sera affich\u00e9e au d\u00e9marrage.";pui.runtimeText.fr_FR["home page url"]="URL de la page d'accueil";pui.runtimeText.fr_FR["home page url hlp"]="D\u00e9finit l'URL du contenu de la page d'accueil. L'URL peut \u00eatre aboslue ou relative.";pui.runtimeText.fr_FR["navi pnl title"]="Titre du panneau de Navigation";pui.runtimeText.fr_FR["navi pnl title hlp"]="D\u00e9finit le texte \u00e0 afficher dans la barre de titre du panneau de Navigation.";
pui.runtimeText.fr_FR["navi pnl width"]="Largeur initiale du panneau de Navigation";pui.runtimeText.fr_FR["navi pnl width hlp"]="D\u00e9finit en pixels la largeur initiale du panneau de Navigation. L'utilisateur peut modifier ou m\u00eame masquer le panneau \u00e0 sa guise. Plage des valeurs valides : 0-2000 pixels.";pui.runtimeText.fr_FR["navi type"]="Type de Navigation";pui.runtimeText.fr_FR["navi type hlp"]='Contr\u00f4le le type de menu utilis\u00e9 dans le panneau de Navigation, "ramification" ou "accord\u00e9on". Ce param\u00e8tre ne s\'applique pas aux barres d\'outils.';
pui.runtimeText.fr_FR["single click nav"]="Navigation en un clic";pui.runtimeText.fr_FR["single click nav hlp"]="Si coch\u00e9, les \u00e9l\u00e9ments du menu dans le panneau de Navigation seront ex\u00e9cut\u00e9 sur un simple clic. Sinon, ils ne seront ex\u00e9cut\u00e9s qu'apr\u00e8s un double-clic. Ce param\u00e8tre ne s'applique pas aux barres d'outils.";pui.runtimeText.fr_FR["current library"]="Biblioth\u00e8que en cours";pui.runtimeText.fr_FR["current library hlp"]="Sp\u00e9cifie la biblioth\u00e8que en cours, *USRPRF or *CRTDFT.";
pui.runtimeText.fr_FR["job descr"]="Description du job";pui.runtimeText.fr_FR["job descr hlp"]="Sp\u00e9cifie la description du job afin d'en d\u00e9duire la liste des biblioth\u00e8ques. *USRPRF peut \u00eatre sp\u00e9cifi\u00e9 si les utilisateurs de l'Atrium ont des profils IBM i.";pui.runtimeText.fr_FR["job descr lib"]="Biblioth\u00e8que de la description du job";pui.runtimeText.fr_FR["job descr lib hlp"]="Sp\u00e9cifie la biblioth\u00e8que pour la description du job. *LIBL ou *CURLIB peuvent \u00eatre sp\u00e9cifi\u00e9es.";
