pui.runtimeText.nl_NL["user profile"]="Gebruikersprofiel";pui.runtimeText.nl_NL["user profile hlp"]="De naam van het gebruikersprofiel. Namen van gebruikersprofielen zijn hoofdlettergevoelig, tenzij de IBM i profielen worden gebruikt.";pui.runtimeText.nl_NL["password hlp"]="Set/reset het wachtwoord. Wachtwoorden zijn hoofdlettergevoelig.";pui.runtimeText.nl_NL["conf password"]="Bevestig wachtwoord";pui.runtimeText.nl_NL["conf password hlp"]="Bij set/reset van het wachtwoord moet de waarde van dit veld exact overeenkomen met het nieuwe wachtwoord. Wachtwoorden zijn hoofdlettergevoelig.";
pui.runtimeText.nl_NL["browser title"]="Titel van de browser";pui.runtimeText.nl_NL["browser title hlp"]="Instellen van de tekst die wordt getoond in de titelbar van de browser.";pui.runtimeText.nl_NL["show banner"]="Toon banner";pui.runtimeText.nl_NL["show banner hlp"]="Haal het vinkje weg bij deze optie als u de banner aan de bovenkant van de portal wilt verbergen.";pui.runtimeText.nl_NL["banner height"]="Banner hoogte";pui.runtimeText.nl_NL["banner height hlp"]="Stelt de hoogte in pixels in van de banner aan de bovenkant van de portal. Deze instelling wordt overgeslagen als de banner niet wordt getoond. Geldige waarden: 0-600 pixels.";
pui.runtimeText.nl_NL["banner url"]="URL van de banner";pui.runtimeText.nl_NL["banner url hlp"]="Stelt de URL in waar de banneropmaak is opgeslagen. URL kan absoluut of gekwalificeerd worden opgegeven.";pui.runtimeText.nl_NL.theme="Thema";pui.runtimeText.nl_NL["theme hlp"]='Stelt het standaard thema in. Dit kan worden gewijzigd door individuele gebruikers als <strong>"Sta gebruikers toe om een thema te selecteren"</strong> actief is.';pui.runtimeText.nl_NL["allow sel theme"]="Sta gebruikers toe om een thema te selecteren";
pui.runtimeText.nl_NL["allow sel theme hlp"]="Als dit is aangevinkt, is het voor gebruikers mogelijk een eigen thema te selecteren met behulp van de control in de toolbar.";pui.runtimeText.nl_NL["show menu search"]="Toon zoekmenu";pui.runtimeText.nl_NL["show menu search hlp"]="Haal vinkje weg om de menu zoekfaciliteit uit te schakelen.";pui.runtimeText.nl_NL["show fav sys"]="Toon de favorieten";pui.runtimeText.nl_NL["show fav sys hlp"]="Haal vinkje weg om de favorieten uit te schakelen.";
pui.runtimeText.nl_NL["limit num sessn"]="Beperk het aantal sessies";pui.runtimeText.nl_NL["limit num sessn hlp"]="Het aantal toegestane Atrium sessies voor deze gebruiker/groep. De waarde nul staat voor een onbeperkt aantal sessies. De beperking geldt per web browser.";pui.runtimeText.nl_NL["show hmpg start"]="Toon home pagina na start";pui.runtimeText.nl_NL["show hmpg start hlp"]="Indien aangevinkt wordt er bij het starten van de portal een eigen home page getoond.";
pui.runtimeText.nl_NL["home page url"]="URL home pagina";pui.runtimeText.nl_NL["home page url hlp"]="Stelt de URL in met de locatie van de home page. URL kan absoluut of gekwalificeerd worden opgegeven.";pui.runtimeText.nl_NL["navi pnl title"]="Title van het navigatie panel";pui.runtimeText.nl_NL["navi pnl title hlp"]="Deze tekst wordt getoond in de titel bar van het navigatie panel.";pui.runtimeText.nl_NL["navi pnl width"]="Breedte van navigatie panel na het opstarten";
pui.runtimeText.nl_NL["navi pnl width hlp"]="Stelt de breedte in pixels in van het navigatie panel na het opstarten. De gebruiker kan de grootte van het panel aanpassen of het panel, indien nodig, verbergen.  Geldige waarden: 0-2000 pixels.";pui.runtimeText.nl_NL["navi type"]="Type navigatie";pui.runtimeText.nl_NL["navi type hlp"]='Stelt binnen de navigatie het type menu in, "tree" of "accordion". Deze instelling is niet van invloed op de toolbar.';pui.runtimeText.nl_NL["single click nav"]="Enkele muisklik navigatie";
pui.runtimeText.nl_NL["single click nav hlp"]="Als deze optie is aangevinkt wordt een menu optie opgestart met een enkele muisklik. Anders wordt een menu optie opgestart met een dubbele klik. Deze instelling is niet van invloed op de toolbar.";pui.runtimeText.nl_NL["current library"]="Huidige bibliotheek";pui.runtimeText.nl_NL["current library hlp"]="Geef de huidige bibliotheek op, *USRPRF, or *CRTDFT.";pui.runtimeText.nl_NL["job descr"]="Job description";pui.runtimeText.nl_NL["job descr hlp"]="Geef een job description op voor de lijst met bibliotheken. *USRPRF kan worden opgegeven als de Atrium gebruikers gelijk zijn aan de IBM i gebruikers profielen.";
pui.runtimeText.nl_NL["job descr lib"]="Job description bibliotheek";pui.runtimeText.nl_NL["job descr lib hlp"]="Geef de bibliotheek op met de job description. Hier kan *LIBL of *CURLIB worden opgegeven.";pui.runtimeText.nl_NL["item name"]="Naam item";pui.runtimeText.nl_NL["item name hlp"]="Stelt de naam in van het display voor het navigatie of toolbar item.";pui.runtimeText.nl_NL["action type"]="Actie type";pui.runtimeText.nl_NL["action type hlp"]="Stelt het type toepassing in dat door dit item wordt gestart.";
pui.runtimeText.nl_NL.url="URL";pui.runtimeText.nl_NL["url hlp"]="Stelt de URL in van de Web toepassing. De URL kan worden opgegeven als een absoluut pad of als een volledig gekwalificeerde URL. In de URL kunnen Query string parameters worden meegegeven.";pui.runtimeText.nl_NL["genie url"]="Genie URL";pui.runtimeText.nl_NL["genie url hlp"]="Stelt de URL in die wordt gebruikt om Genie te starten. Als hier niets wordt ingevuld wordt de standaard Genie URL /profoundui/auth/genie gebruikt. Dit veld is handig als er een andere Genie URL nodig is of als er met query string parameters wordt  gewerkt. Bijvoorbeeld: /profoundui/auth/genie?skin=MyCompany";
pui.runtimeText.nl_NL["open as"]="Openen als";pui.runtimeText.nl_NL["open as hlp"]="Keuze of de toepassing onder een nieuwe tab in de portal wordt gestart, of in een afzonderlijke browser window of een tab. Of de browser een nieuwe window gebruikt of een tab is afhankelijk van de gebruikersinstelling in de browser.";pui.runtimeText.nl_NL["opens once only"]="Open eenmalig";pui.runtimeText.nl_NL["opens once only hlp"]="Standaard wordt er een nieuwe tab geopend met het opstarten van een item. Als er al een tab is geopend in de portal wordt er een nieuwe toegevoegd. Er is geen limiet aan het aantal tabs dat op deze manier kan worden geopend. Als deze optie wordt aangevinkt kan de gebruiker niet meer dan 1 tab per item openen. Als er al een tab is geopend voor dit item zal deze na de selectie worden gebruikt. Deze optie is niet actief als er is gekozen voor het openen van het item in een afzonderlijk browser window of tab.";
pui.runtimeText.nl_NL.icon="Icon";pui.runtimeText.nl_NL["icon hlp"]="Optioneel. Geef de naam op van een icon file voor gebruik door het navigatie of toolbar item. Geldige icon file formaten zijn GIF, JPG, or PNG. Het wordt aanbevolen om transparente GIFs te gebruiken. Gebruik het absolute pad van de root van de Atrium installatie. Als er geen icon is opgegeven gebruikt Atrium een default icon voor de navigatie. Mits hier opgegeven, worden er geen icons voor de toolbar items getoond.";
